package com.hhnail.algorithm.leetcode.datastructure01.day06;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

/**
 * leetcode 242. 有效的字母异位词
 * https://leetcode-cn.com/problems/valid-anagram/
 */
public class IsAnagram {
	public static void main(String[] args) {
		String s = "",
				t = "";
		System.out.println(isAnagram(s, t));
	}

	public static boolean isAnagram(String s, String t) {
		Map<Character, Integer> map1 = new HashMap();
		Map<Character, Integer> map2 = new HashMap();
		for (int i = 0; i < s.length(); i++) {
			char letter = s.charAt(i);
			if (map1.containsKey(letter)) {
				map1.replace(letter, (map1.get(letter) + 1));
			} else {
				map1.put(letter, 1);
			}
		}

		for (int i = 0; i < t.length(); i++) {
			char letter = t.charAt(i);
			if (map2.containsKey(letter)) {
				map2.replace(letter, (map2.get(letter) + 1));
			} else {
				map2.put(letter, 1);
			}
		}

		if (map1.size() != map2.size()) {
			return false;
		}

		for (Map.Entry<Character, Integer> entry : map1.entrySet()) {
			Character key = entry.getKey();
			Integer value = entry.getValue();
			if (!map2.getOrDefault(key, 0).equals(value)) {
				return false;
			}
		}
		return true;
	}
}
